* As we see in the two structures, names and values are displayed * for primitive components of an object, and expandable names are * shown for object components (location, in this case). * * Under "this", the debugger displays items corresponding to: * (a) local variables of the object. * (b) global variables of the object. * (c) properties of the object. * * In the tree view, ObjectEditor displays items corresponding to: * * (a) local variables of the object. * (b) global variables of the object. * (c) properties of the object. * * (T/F) A debugger shows the physical structure of an object. * (T/F) ObjectEditor shows the physical structure of an object. * * The logical structure of an object is its decomposition by its: * (a) variables. * (b) properties. * */ /* * STRUCTURE-BASED TERMINOLOGY * * Both physical and logical structures involve common concepts of root, * internal nodes, and leaves,defined below. * * In computer science, the items in a structure are called nodes, * which have names and possibly values and children (sub structures). * * A node with no children is a leaf node in the structure. * * A non leaf node is a parent or structured node. * * A node with no parent is a root node in the structure. * * Any node that is not a leaf or root is an internal or interior node. * * If B is the child of A, and C is a child (or descendant) of B then * B and C are descendants of A and A and B are ancestors of C. * * A path from an ancestor to a descendant is a series of connected edges * (representing parent-child edges)leading from the ancestor to the descendant. * * The length of the path is the number of edges in the path. * * A node is considered to have a path to itself of length 0. * * (T/F) In (logical or physical) structure with a unique root, a path exists from * the root to every other node. * * (T/F) In (logical or physical) structure with a unique root, a path exists from * each parent node to every other node. * * Children of the same node are called siblings. * * To visualize the structure, a parent is connected to a child through a * (directed) line segment called an edge that goes from parent to child. * Usually the arrow in the segment is not shown as the parent is drawn * above the child. * The tree view in object editor uses such a visualization. * The debugger uses indentation to show child relationships. * * An edge is a: * a) directed line segment showing a parent-child relationship. * b) undirected line segment showing a parent-child relationship. * c) the set of all leaf nodes. * d) None of the above. * * Nodes represent the: * parent-child relationships among the element compositions in a structure. * elements themselves. * None of the above. *
* Identify the root, a leaf, a parent, and an internal node * in the two structures. * * (T/F) The physical structure of ALineWithObjectProperty has a parent * node labeled "location". * * (T/F) The physical structure of ALineWithObjectProperty has a root * node labeled "this". * * (T/F) The physical structure of ALineWithObjectProperty has a parent * node labeled "this". * * (T/F) The physical structure of ALineWithObjectProperty has a parent * node labeled "x". * * (T/F) The physical structure of ALineWithObjectProperty has a leaf * node labeled "radius". * * (T/F) The logical structure of ALineWithObjectProperty has a leaf * node labeled "Radius". * * Now comment out the statement in the constructor that assigns to location * and debug the program again (F11), stepping into the break point.
* Can you explain how each of the two tree views has changed and why? * * Do the tree views show the same nodes as previously? * * Does the debugger show the same nodes as previously when you call setLocation? * * (T/F) Different instances of the same class can have different logical structures * depending on if and what values are assigned to the properties. * * (T/F) Different instances of the same class can have different physical structures * depending on if and what values are assigned to the variables. */
/* * ATOMIC VS STRUCTURED TYPE * * A type whose logical and physical structure has only one leaf node is an * atomic type - it cannot be decomposed into multiple components. * * A primitive type is always an atomic type. * * Some object types may also be atomic types depending on the instance * variables/properties they define. * * A non-atomic type is a structured type - these types can be decomposed into * more than one component. * * * (T/F) int is an atomic type * * Go to the declaration of Point * * (T/F) Point is a structured type. * * Go to the declaration of MyInteger * * (T/F) MyInteger is a structured type. */
/* * COMPOSITE VS. NON-COMPOSITE TYPES * * A structured type with at least one internal structured node is a * composite type - such a type has a component that is itself structured. * * (T/F) Point is a composite type. * (T/F) ALineWithObjectProperty is a composite type. * */ /* * COMPOSITE SHAPES VS OBJECTS * * In this example, the ObjectEditor tree view was structured but not the * graphics view, because the object simply represented a line that used a * Point object rather than x,y coordinates for the location. * (We recommend using x,y coordinates for location in your project to avoid * some subtle problems) * * The next example shows a structured shape. * * Next class: ACartesianPlane * */

