package geometryFigs;

import util.annotations.StructurePattern;
import util.annotations.StructurePatternNames;
import util.annotations.Tags;
import lectures.graphics.extra.APolarPoint;
import tags301.Comp301Tags;


@StructurePattern(StructurePatternNames.LINE_PATTERN)


public class RotatingLine implements MovingL {

	private int x; //= 0;
	private int y;//= 0;		
	private APolarPoint lowerRC;
	private double radius, angle;



	public RotatingLine() {
		lowerRC = new APolarPoint(radius, angle);
	}
	public RotatingLine(double initRad, double initAng) {
		radius = initRad;
		angle = initAng;
		lowerRC = new APolarPoint(radius, angle);
	}

	public int getX(){
		return x;
	}
	public void setX(int newX) {
		x = newX;
	}
	public int getY() {
		return y;
	}
	public void setY(int newY) {
		y = newY;
	}
	public int getHeight() {
		return lowerRC.getY();
	}
	public int getWidth() {
		return lowerRC.getX();
	}
	public double getRadius() {
		return lowerRC.getRadius();
	}
	public void setRadius(double newR) {
		radius = newR;
		lowerRC = new APolarPoint(radius, angle);
	}
	public double getAngle() {
		return lowerRC.getAngle();
	}
	public void setAngle(double newAng) {
		angle = newAng;
		lowerRC = new APolarPoint(radius, angle);
	}
	public void rotate(int units) {
		double radianUn = units*(Math.PI/32);
		double newAngle = radianUn + angle;
		this.setAngle(newAngle);
	}



}

