package grail.geometryFigs;

import util.annotations.StructurePattern;
import util.annotations.StructurePatternNames;
import util.annotations.Tags;
import lectures.graphics.extra.APolarPoint;
import tags301.Comp301Tags;


@StructurePattern(StructurePatternNames.LINE_PATTERN)
@Tags(Comp301Tags.ROTATING_LINE) 

public class RotatingLine implements MovingL {

	private int x; //= 0;
	private int y;//= 0;		
	private APolarPoint lowerRC;
	private double radius, angle;



	public RotatingLine() {
		lowerRC = new APolarPoint(radius, angle);
	}
	public RotatingLine(int initx, int inity) {
		x = initx;
		y = inity;
	}
	public RotatingLine(double initRad, double initAng, int initx, int inity) {
		x = initx;
		y = inity;
		radius = initRad;
		angle = initAng;
		lowerRC = new APolarPoint(radius, angle);
	}

	public int getX(){
		return x;
	}
	public void setX(int newX) {
		x = newX;
	}
	public int getY() {
		return y;
	}
	public void setY(int newY) {
		y = newY;
	}
	public int getHeight() {
		return lowerRC.getY();
	}
	public int getWidth() {
		return lowerRC.getX();
	}
	public double getRadius() {
		return lowerRC.getRadius();
	}
	public void setRadius(double newR) {
		radius = newR;
		lowerRC = new APolarPoint(radius, angle);
	}
	public double getAngle() {
		return lowerRC.getAngle();
	}
	public void setAngle(double newAng) {
		angle = newAng;
		lowerRC = new APolarPoint(radius, angle);
	}
	public void rotate(int units) {
		double radianUn = units*(Math.PI/32);
		double newAngle = radianUn + angle;
		this.setAngle(newAngle);
	}



}

package grail.compositeFigs;

import bus.uigen.OEFrame;
import bus.uigen.ObjectEditor;
import grail.geometryFigs.MovingL;
import grail.geometryFigs.RotatingLine;
import util.annotations.StructurePattern;
import util.annotations.StructurePatternNames;

@StructurePattern(StructurePatternNames.LINE_PATTERN)

public class ArmsandLegs implements VShapes {

	//int x;
	//int y;
	MovingL LeftLine;
	MovingL RightLine;

	public ArmsandLegs() {
		LeftLine = new RotatingLine();
		RightLine = new RotatingLine();
	}
	public ArmsandLegs(double rad, double ang,double radR, double angR, int valX, int valY) {
		LeftLine = new RotatingLine(rad, ang, valX, valY);
		RightLine = new RotatingLine(radR, angR, valX, valY);
	}


	public MovingL getLeftLine() {
		return LeftLine;
	}

	public MovingL getRightLine() {
		return RightLine;
	}

	public void move(int newX, int newY) {
		LeftLine.setX(LeftLine.getX() + newX);
		LeftLine.setY(LeftLine.getY() + newY);
		RightLine.setX(newX);
		RightLine.setY(newY);

	}

	 public static void main (String[] args ) {
	    	OEFrame anOEFrame = ObjectEditor.edit(new ArmsandLegs(30, (Math.PI/4), 30, 3*(Math.PI/4), 100, 100));
	    	anOEFrame.showTreePanel(); // shows an extra panel, optional call

	    }

}
